  false,\n\t\"url\": null,\n\t\"notes\": \"n               Congressional Districts
  are the 435 areas from which people are elected to the U.S. House of Representatives.
  After the apportionment of congressionaln               seats among the States based
  on census population counts, each State is responsible for establishing congressional
  districts for the purpose of electingn               representatives. Each congressional
  district is to be as equal in population to all other congressional districts in
  a State as practicable. The 114thn               Congress is seated from January
  2015 to 2017. The TIGER/Line shapefiles for the District of Columbia, Puerto Rico,
  and the Island Areas (American Samoa,n               Guam, the Commonwealth of the
  Northern Mariana Islands, and the U.S. Virgin Islands) each contain a single record
  for the non-voting delegate district inn               these areas. The boundaries
  of all other congressional districts are provided to the Census Bureau through the
  Redistricting Data Program (RDP).n            \",\n\t\"license_title\": null,\n\t\"extras\":
